import React from 'react';

export const Song = (props)=>{
    return(
        <div>
            <img src={props.song.image} alt=""/>
            <p>{props.song.trackName}</p>
            <button onClick = {()=>{props.add(props.song)}}>Add this song</button>
        </div>
    )
}
